import React from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import { Container, Navbar } from 'react-bootstrap';

// 1. Import our new custom CSS
import './App.css';

// 2. Import a code icon
import { FaCode } from 'react-icons/fa';

// 3. Import our components
import HomePage from './components/HomePage';
import SnippetPage from './components/SnippetPage';

function App() {
  return (
    <Router>
      {/* We'll use the 'dark' variant for a dark navbar */}
      <Navbar bg="dark" variant="dark" expand="lg" className="mb-4">
        <Container>
          <Navbar.Brand as={Link} to="/">
            {/* 4. Add the icon! */}
            <FaCode className="me-2" /> CodeBin
          </Navbar.Brand>
        </Container>
      </Navbar>

      {/* This div will hold our main content */}
      <div className="app-container">
        <Routes>
          <Route path="/" element={<HomePage />} />
          <Route path="/snippet/:id" element={<SnippetPage />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
